import './app.css';
import CoinPrice from './coin_price/coin_price';
import Header from './header/header';
import SelectCoin from './select_coin/select_coin';

function App() {
  return (
    <div className="App">
      <Header />
      <SelectCoin />
      <CoinPrice/>
    </div>
  );
}

export default App;
